description:
This is a chapter by chapter and verse by verse study of the book of Revelation as taught by Dr. Arnold Murray of the Shepherd's Chapel in 2010. His scholarly no nonsense / non-denominational approach brings forth the Word in a manner that a child can understand.

If you don't have a King James Bible, the scriptures are shown on-screen as he goes through them.

